COMMENT '-- Author:       VinhKT
  -- Created date:  22/10/2022
  -- Description:   lấy chi tiết reqeust
  -- Modified by:
  '
BEGIN
  -- Code chạy thử: CALL `misa-learn-gd1`.proc_request_Detail('11d15295-2324-7403-261e-086412a8ea97');
  SELECT
    r.*,
    e.DepartmentId,
    d.DepartmentName,
    e.FullName
  FROM request r
    JOIN employee e
      ON r.EmployeeId = e.EmployeeID
    JOIN department d
      ON e.DepartmentId = d.DepartmentId
  WHERE OverTimeId = v_id;
END
$$

