--
-- Create procedure `proc_request_GetAllFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_request_GetAllFilter (IN v_Where text)
COMMENT '-- Author:       VinhKT
  -- Created date:  15/09/2022
  -- Description:   lấy tất cả  nhân viên theo filter
  -- Modified by:
  -- Code chạy thử: CALL `misa-learn-gd1`.proc_request_GetAllFilter("EmployeeName like ''%linh%''");'
BEGIN
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  SET @filterQuery = CONCAT('select * FROM request where ', v_Where, ' ORDER BY ModifiedDate DESC');
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

END
$$

--
-- Create procedure `proc_request_Filter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_request_Filter (IN v_Offset int, -- số thứ tự của bản ghi bắt đầu lấy
IN v_Limit int, -- số bản ghi muốn lấy kể từ offset
IN v_Where text)
COMMENT '-- Author:       VinhKT
  -- Created date:  22/10/2022
  -- Description:   Lấy danh sách request và tổng số request có phân trang
  -- Modified by:
  -- Code chạy thử: CALL `misa-learn-gd1`.Proc_request_Filter(0, 10, NULL, "FullName like ''''%Trường%''''");'
BEGIN
  IF IFNULL(v_where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  -- SET @filterQuery = CONCAT('select * from request where ', v_Where, ' order by (CAST(SUBSTRING(EmployeeCode, 3) AS UNSIGNED )) desc ', 'limit ', v_Limit, ' offset ', v_Offset);

  SET @filterQuery = CONCAT('select r.*,e.EmployeeCode, e.FullName, e.DepartmentId, d.DepartmentName, p.PositionName, e.PositionId,e1.FullName as ApprovalToName from request r join employee e on r.EmployeeId = e.EmployeeId join employee e1 on r.ApprovalToId = e1.EmployeeId join department d on e.DepartmentId = d.DepartmentId join position p on e.PositionId = p.PositionId where ', v_Where, ' order by r.ModifiedDate desc ', 'limit ', v_Limit, ' offset ', v_Offset);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @count = CONCAT('select count(*) from(', ' select count(*) from request r join employee e on r.EmployeeId = e.EmployeeId where ', v_Where, ' group by r.OverTimeId', ' ) t');

  PREPARE count FROM @count;
  EXECUTE count;
  DEALLOCATE PREPARE count;

END
$$

