--
-- Create procedure `proc_employee_GetAllFilter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_employee_GetAllFilter (IN v_Where varchar(255))
COMMENT '-- Author:       VinhKT
  -- Created date:  15/09/2022
  -- Description:   lấy tất cả  nhân viên theo filter
  -- Modified by:
  -- Code chạy thử: CALL `misa-learn-gd1`.proc_employee_GetAllFilter("EmployeeName like ''%linh%''");'
BEGIN
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  SET @filterQuery = CONCAT('select * FROM employee where ', v_Where, ' ORDER BY EmployeeCode DESC');
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
-- select * FROM employee WHERE v_Where;
END
$$

--
-- Create procedure `proc_employee_GetAll`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE proc_employee_GetAll ()
COMMENT '-- Author:       VinhKT
  -- Created date:  15/09/2022
  -- Description:   lấy tất cả  nhân viên
  -- Modified by:
  -- Code chạy thử: CALL `misa-learn-gd1`.proc_employee_GetAll();'
BEGIN
  SET @filterQuery = ('select e.*, d.DepartmentName FROM employee e join department d on e.DepartmentId = d.DepartmentId order by e.FullName');
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

--
-- Create procedure `Proc_employee_Filter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_employee_Filter (IN v_Offset int, -- số thứ tự của bản ghi bắt đầu lấy
IN v_Limit int, -- số bản ghi muốn lấy kể từ offset
IN v_Where varchar(255))
COMMENT '-- Author:       VinhKT
  -- Created date:  15/09/2022
  -- Description:   Lấy danh sách nhân viên và tổng số nhân viên có phân trang
  -- Modified by:
  -- Code chạy thử: CALL `misa-learn-gd1`.Proc_employee_Filter(0, 10, NULL, "FullName like ''''%Trường%''''");'
BEGIN
  IF IFNULL(v_where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  -- SET @filterQuery = CONCAT('select * from employee where ', v_Where, ' order by (CAST(SUBSTRING(EmployeeCode, 3) AS UNSIGNED )) desc ', 'limit ', v_Limit, ' offset ', v_Offset);
  SET @filterQuery = CONCAT('select * from employee where ', v_Where, ' order by ModifiedDate desc ', 'limit ', v_Limit, ' offset ', v_Offset);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @count = CONCAT('select count(*) from employee where ', v_Where);

  PREPARE count FROM @count;
  EXECUTE count;
  DEALLOCATE PREPARE count;

END
$$

